    false,nt"url": null,nt"notes": "Title: Combined Threats to Idaho's Forests
    The values for each 30 meter cell in each of the "Benefits" issues are added together.
    The key issues for which forests provide benefits in Idaho were: 1. Forest health,
    2. Uncharacteristic wildland fire, and 3. Potential loss of canopy due to development,
    urbanization and recreation. The scores for all cells are then stratified into five
    classes using natural breaks. This composite benefits map identifies the areas with
    the least benefit through those with the greatest benefits as identified in the
    issues and sub-issues used in the assessment. Idaho Statewide Assessment of Forest
    Resources document contains additional information and can be found at: http://www.idl.idaho.gov/bureau/ForestAssist/safr/final/061410-ID-SAFR-FINAL.pdf.",nt"license_title":
